import React from "react";
import "./Menu.css";

function Menu() {
  return (
    <nav className="navbar">
      <div className="navbar-logo">Seu Logo Aqui</div>
      <div className="navbar-logout">
        <button className="logout-button">Sair</button>
      </div>
    </nav>
  );
}

export default Menu;
